import React, { useEffect } from "react";

const RealisticCheeseCornPizza = () => {
  useEffect(() => {
    const pizzaCanvas = document.getElementById("pizzaCanvas");
    const pizzaCtx = pizzaCanvas.getContext("2d");

    // Draw Pizza Base with texture and details (Dough)
    pizzaCtx.fillStyle = "#e2b97f"; // Dough color (light brown)
    pizzaCtx.beginPath();
    pizzaCtx.arc(100, 100, 80, 0, 2 * Math.PI);
    pizzaCtx.fill();

    // Adding shading for the crust (Golden, slightly darker)
    pizzaCtx.fillStyle = "#d68f3b";
    pizzaCtx.beginPath();
    pizzaCtx.arc(100, 100, 90, 0, 2 * Math.PI);
    pizzaCtx.fill();

    // Add some texture on the crust (darkened edges)
    pizzaCtx.strokeStyle = "#b27a48"; // Darker edge for crust
    pizzaCtx.lineWidth = 5;
    pizzaCtx.beginPath();
    pizzaCtx.arc(100, 100, 90, 0, 2 * Math.PI);
    pizzaCtx.stroke();

    // Tomato Sauce with depth (darker center)
    pizzaCtx.fillStyle = "#d93d3d";
    pizzaCtx.beginPath();
    pizzaCtx.arc(100, 100, 75, 0, 2 * Math.PI);
    pizzaCtx.fill();

    // Extra Cheese Layer (Yellow cheese with depth)
    pizzaCtx.fillStyle = "#f9d75c";
    pizzaCtx.beginPath();
    pizzaCtx.arc(100, 100, 70, 0, 2 * Math.PI);
    pizzaCtx.fill();

    // Adding highlights for cheese (shine effect)
    pizzaCtx.fillStyle = "rgba(255, 255, 255, 0.5)";
    pizzaCtx.beginPath();
    pizzaCtx.arc(100, 70, 60, 0, 2 * Math.PI); // Slight glow effect for cheese
    pizzaCtx.fill();

    // Corn Kernels (Yellow kernels)
    pizzaCtx.fillStyle = "#ffeb3b"; // Corn yellow
    pizzaCtx.beginPath();
    pizzaCtx.arc(50, 70, 8, 0, 2 * Math.PI); // Positioning corn kernels
    pizzaCtx.fill();

    pizzaCtx.beginPath();
    pizzaCtx.arc(150, 70, 8, 0, 2 * Math.PI);
    pizzaCtx.fill();

    pizzaCtx.beginPath();
    pizzaCtx.arc(80, 140, 8, 0, 2 * Math.PI);
    pizzaCtx.fill();

    pizzaCtx.beginPath();
    pizzaCtx.arc(120, 140, 8, 0, 2 * Math.PI);
    pizzaCtx.fill();

    pizzaCtx.beginPath();
    pizzaCtx.arc(60, 160, 8, 0, 2 * Math.PI);
    pizzaCtx.fill();

    pizzaCtx.beginPath();
    pizzaCtx.arc(140, 160, 8, 0, 2 * Math.PI);
    pizzaCtx.fill();

    // Mushrooms with shading (realistic appearance)
    pizzaCtx.fillStyle = "#a68f62"; // Mushrooms
    pizzaCtx.beginPath();
    pizzaCtx.arc(120, 110, 8, 0, 2 * Math.PI);
    pizzaCtx.fill();

    pizzaCtx.beginPath();
    pizzaCtx.arc(60, 120, 8, 0, 2 * Math.PI);
    pizzaCtx.fill();

    // Black Olives (Realistic shade)
    pizzaCtx.fillStyle = "#4d4d4d"; // Black Olives
    pizzaCtx.beginPath();
    pizzaCtx.arc(90, 80, 6, 0, 2 * Math.PI);
    pizzaCtx.fill();

    pizzaCtx.beginPath();
    pizzaCtx.arc(110, 120, 6, 0, 2 * Math.PI);
    pizzaCtx.fill();

    // Onions (Sliced thin)
    pizzaCtx.fillStyle = "#f5b82d"; // Onions
    pizzaCtx.beginPath();
    pizzaCtx.arc(70, 100, 6, 0, 2 * Math.PI);
    pizzaCtx.fill();

    // Cheese Stretch (Effect for a real cheese pull)
    pizzaCtx.strokeStyle = "#f9d75c";
    pizzaCtx.lineWidth = 3;
    pizzaCtx.beginPath();
    pizzaCtx.moveTo(80, 90);
    pizzaCtx.lineTo(120, 110); // Cheese stretching towards the slice
    pizzaCtx.stroke();

    pizzaCtx.beginPath();
    pizzaCtx.moveTo(110, 90);
    pizzaCtx.lineTo(90, 110);
    pizzaCtx.stroke();

    // Slice the pizza (for a real slice effect)
    pizzaCtx.strokeStyle = "#f9d75c";
    pizzaCtx.lineWidth = 5;
    pizzaCtx.beginPath();
    pizzaCtx.moveTo(100, 100);
    pizzaCtx.lineTo(170, 40); // Creating a slice visual
    pizzaCtx.stroke();

    pizzaCtx.beginPath();
    pizzaCtx.moveTo(100, 100);
    pizzaCtx.lineTo(30, 40); // Creating a slice visual
    pizzaCtx.stroke();
  }, []);

  return (
    <div style={styles.container}>
      <h2 style={styles.heading}>Realistic Cheese Corn Pizza</h2>
      <div style={styles.canvasContainer}>
        <canvas id="pizzaCanvas" width="200" height="200" style={styles.canvas}></canvas>
      </div>
    </div>
  );
};

const styles = {
  container: {
    textAlign: "center",
    padding: "20px",
    background: "linear-gradient(135deg, #ffe5d9, #fbd9e1)",
    borderRadius: "10px",
    boxShadow: "0px 4px 8px rgba(0, 0, 0, 0.2)",
    maxWidth: "500px",
    margin: "auto",
  },
  heading: {
    color: "#f04e8c",
    fontFamily: "'Poppins', sans-serif",
    marginBottom: "20px",
    fontSize: "24px",
  },
  canvasContainer: {
    display: "flex",
    justifyContent: "center",
    gap: "30px",
  },
  canvas: {
    border: "3px solid #f04e8c",
    borderRadius: "10px",
    backgroundColor: "#ffffff",
  },
};

export default RealisticCheeseCornPizza;
